import client from './client';

export const login = ({username, password}) => 
    client.post('http://localhost:8000/api/auth/login', {username, password});

export const register = ({username, password}) =>
    client.post('http://localhost:8000/api/auth/register', {username, password});

export const check = () => client.get('http://localhost:8000/api/auth/check');
